-- ----------------------------
-- Table structure for yii_article
-- ----------------------------
DROP TABLE IF EXISTS `yii_article`;
CREATE TABLE `yii_article` (
  `ac_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ac_title` varchar(40) NOT NULL DEFAULT '' COMMENT '文章标题',
  `ac_info` varchar(100) NOT NULL DEFAULT '' COMMENT '文章简介',
  `ac_thumb` varchar(255) NOT NULL DEFAULT '' COMMENT '文章缩略图',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `updated_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `ac_tags` varchar(255) DEFAULT NULL COMMENT '文章标签',
  `ac_type` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '文章类型, 1原创,2转载,3翻译',
  `genre_id` int(11) unsigned NOT NULL DEFAULT '3' COMMENT '类型id 2图片,3技术文章',
  `category_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '类别id',
  `ac_unique` varchar(255) DEFAULT '' COMMENT '唯一性标识字段',
  PRIMARY KEY (`ac_id`),
  KEY `ac_unique` (`ac_unique`),
  KEY `ac_tid` (`category_id`),
  FULLTEXT KEY `ac_tags` (`ac_tags`)
) ENGINE=InnoDB AUTO_INCREMENT=14437 DEFAULT CHARSET=utf8 COMMENT='文章表';

